CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetAllMCDInfo`(IN `userID` INT, IN `toDate` DATETIME)
Begin
IF(userID =0)Then
SELECT * 
FROM `mcdinfo`
where `CollectionPurpose` ='agentTopup'
and  `VoidStatus`=1
ORDER BY `MCDID` DESC;

ELSE
SELECT * 
FROM `mcdinfo`
where `CollectionPurpose` ='agentTopup'
AND `IssuerID`= userID
AND DATE_FORMAT(`MCDDate`, '%Y-%m-%d')= DATE_FORMAT(toDate, '%Y-%m-%d') 
and  `VoidStatus`=1
ORDER BY `MCDID` DESC;
 END IF;
 END$$

CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetAllMCDInfoByByDateandStatus`(IN `fromDate` DATETIME, IN `toDate` DATETIME, IN `status` INT)
Begin
