SELECT * 
FROM `mcdinfo`
where DATE_FORMAT(`MCDDate`, '%Y-%m-%d') 
BETWEEN DATE_FORMAT(fromDate, '%Y-%m-%d') 
AND DATE_FORMAT(toDate, '%Y-%m-%d')
and `VoidStatus`=1
ORDER BY `MCDID` DESC;

