CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetDailySalesDetails`(IN `userID` INT, IN `pnr` VARCHAR(50), IN `formDate` DATETIME, IN `toDate` DATETIME)
Begin

