CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetDailySalesShortSummarybyCounter`(IN `counter` VARCHAR(50))
BEGIN
IF(counter='')THEN
SELECT distinct
`CounterCode` as CuntrCode,
`SaleDate` as SelDate, 
(Select SUM(`Amount`) FROM `dailyentry` WHERE `SaleDate`= SelDate and `CounterCode` = CuntrCode ) as TotalSales,
CONCAT( `CounterCode`,DATE_FORMAT( `SaleDate`, '%Y-%m-%d')) as CodeDate    
FROM `dailyentry` 
WHERE `Status`=1 
Order by `SaleDate` DESC;

ELSE
SELECT distinct
`CounterCode` as CuntrCode,
`SaleDate` as SelDate, 
(Select SUM(`Amount`) FROM `dailyentry` WHERE `SaleDate`= SelDate and `CounterCode` = CuntrCode ) as TotalSales,
CONCAT( `CounterCode`,DATE_FORMAT( `SaleDate`, '%Y-%m-%d')) as CodeDate    
FROM `dailyentry` 
WHERE `Status`=1
AND `CounterCode` = counter
Order by `SaleDate` DESC;
END IF;
END$$

