CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetDepositInfo`(IN `fromDate` DATETIME, IN `toDate` DATETIME)
SELECT
d.`MCD_NO`,
m.`MCDDate`, 
m.`CollectionPurpose`,
m.`PaidAmount` ,
d .`DEPOSIT_TYPE`,
d .`DEPOSIT_RECEIVE_DATE`,
d.`DepositedAmount`,
d.`BANK_CHARGE`,  
d.`OutStanding`,
m.`StationOffice`,
m.`ModeOfPayment`,
m.`ChequeNo`

FROM `depositinfo`d 
JOIN  `mcdinfo` m on d.`MCDID` = m.`MCDID`
Where d.`VoidStatus` = 1 
AND DATE_FORMAT(d.`DEPOSIT_RECEIVE_DATE`, '%Y-%m-%d')  between DATE_FORMAT(fromDate, '%Y-%m-%d')  and DATE_FORMAT(toDate, '%Y-%m-%d') ORDER BY  d.`MCD_NO`$$

